import React from 'react';
import { NavLink, useHistory } from 'react-router-dom';
import { Navbar, Nav, Container, Button } from 'react-bootstrap';
import { FaSignInAlt, FaUserCircle } from 'react-icons/fa';
import 'bootstrap/dist/css/bootstrap.min.css';
<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/5.15.4/css/all.min.css" integrity="sha512-1sFRk1Lo2Cj7pEuNlwRpbYd3s8WLa+7VgweVC5I4B+DeOgbe4fPeCxu4NvABKg+qNNQbBRcmcbatZx8efWY9LQ==" crossorigin="anonymous" referrerpolicy="no-referrer" />


const MyNavbar = (props) => {
    let Navigate = useHistory();
    return (
        <>
            <Navbar bg="primary" data-bs-theme="dark">
            <Container>
                <Navbar.Brand as={NavLink} to="/">
                    <img 
                        alt=''
                        src='./polylogo.png'
                        width='90'
                        height='30'
                        />{' '}
                    Navbar
                </Navbar.Brand>
                    <Nav className="me-auto">
                        <Nav.Link as={NavLink} to="/Home">Home</Nav.Link>
                        <Nav.Link as={NavLink} to="/something">Something</Nav.Link>
                        <Nav.Link as={NavLink} to="/somethingElse">Something Else</Nav.Link>
                    </Nav>
                    <Nav>
                        <Button as={NavLink} to="/Login" variant="outline-light" className="me-2" onClick={()=> {Navigate('/Login')}}>
                            <FaUserCircle /> Login
                        </Button>
                        <Button as={NavLink} to="/Signup" variant="outline-light">
                            <FaSignInAlt /> SignUp
                        </Button>
                    </Nav>
                </Container>
            </Navbar>
        </>
    );
}

          
export default MyNavbar;
          






